Defendant Akeem S Cole in court with attorney Ann Heaps.  Defendant Akeem S Cole in custody.  Antonella Aleman appeared for the State of Wisconsin.  Matter is scheduled for plea and sentencing hearing today.  Defendant has additional matters scheduled today (14CF3173 & 15CF665).  Parties have reached a global resolution as to all matters.  Defendant changes plea to guilty in this case and 14CF3173.  On motion of the State, Court orders BOTH COUNTS in case 15CF665 DISMISSED & READ-IN.  Pursuant to plea negotiations and on motion of the State, Court orders COUNTS 3 & 4 DISMISSED AND READ-IN.  Defendant changes plea to guilty as to COUNTS 1 & 2.  Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty.  Court found that defendant freely, voluntarily and intelligently waived his rights.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty as charged in the information and ordered a Judgment of Conviction be entered on the record.  Defendant is advised he is a convicted felon and may not possess any firearms.  Defendant is advised he is unable to vote in any election until civil rights are restored.  Defendant further advised that if he is not a US citizen deportation is possible.  Matter scheduled for sentencing and restitution hearing.  Sentencing hearing scheduled for June 2, 2016 at 01:30 pm.

